import { GET_DOG_ID, GET_DOGS, GET_TEMPERAMENTS } from './actions/types'


const initialState = {
  dogs: [],
  currentDog: null,
  temperaments: [],
  filters: {
    name: '',
    temperament: '',
    weight: '',
    height: '',
    life_span: '',
  },
  sort: '',
  page: 1,
};

const reducer = (state = initialState, { type, payload }) => {
    switch (type) {
        case GET_DOGS:

            return {
                ...state
            }
        case GET_TEMPERAMENTS:

            return {
                ...state
            }
        case GET_DOG_ID:

            return {
                ...state
            }

        default:
            return { ...state }
    }
}

export default reducer;
